import React from 'react'
import TodoListItem from "../TodoListItem";

const TodoList = ({data}) => {
    return (
        <div>
            <ul>
                {data.map(({label}) => {
                    console.log(label);
                    return  <TodoListItem data = {label}/>
                })}

            </ul>
        </div>
    )
};

export default TodoList;
